import React from "react";
import "../stylesComponents/gifgrid.scss";

const GifGridItem = ({ title, url, id }) => {
  const copyUrl = () => {
    url.textContent;

  };
  return (
    <div onClick={copyUrl} className="card">
      <img src={url} alt={title} />
      <p>{title}</p>
      <p>{url}</p>
    </div>
  );
};

export default GifGridItem;

